import styles from "./SobreMim.module.css";
import PostModelo from "componentes/PostModelo";
import fotoCapa from 'assets/sobre_mim_capa.png';

export default function SobreMim() {
    return (
        <PostModelo
            fotoCapa={fotoCapa}
            titulo="Sobre Mim"
        >
            <h3 className={StyleSheet.subtitulo}>
                Olá, eu sou o Jacson!
            </h3>
            <img />
        </PostModelo>
    )
}
